  return (
    <div className="App">
      <div className="grid grid-cols-[20%,80%] min-h-screen">
        <Leftbar></Leftbar>
        <Gallery class="gallery"></Gallery>
      </div>
      <Link to="/welcome">click welcome</Link>
    </div>
  );
}

export default App;
